import React from 'react';
import { IconButton, Grid } from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowLeftIcon from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';

const ComparisonSudokuCell = ({
  cellData,
  onClick,
  manualPencilMode,
  manualPencilColors,
  manualPencilMarks,
  handlePencilMarksChange,
  handleCellChange,
  showPencilMarks,
  isOriginalCell,
  isUserCell,
  pencilMarks,
  generatedCellValue,
  selectedColor,
  applyColorToCell,
}) => {
  const { value, symbol } = cellData;

  const getArrowIconRotation = (cellValue) => {
    if (cellValue === '<') {
      return 'rotate(180deg)';
    } else if (cellValue === '>') {
      return 'rotate(0deg)';
    } else if (cellValue === 'v') {
      return 'rotate(90deg)';
    } else if (cellValue === '^') {
      return 'rotate(270deg)';
    }
    return 'none';
  };

  return (
    <div className="sudoku-cell" onClick={onClick}>
      <Grid container direction="column">
        <Grid item container justifyContent="space-between">
          <IconButton size="small">
            <KeyboardArrowUpIcon className={`arrow-icon ${symbol === '^' && 'up'}`} />
          </IconButton>
          <IconButton size="small">
            <KeyboardArrowDownIcon className={`arrow-icon ${symbol === 'v' && 'down'}`} />
          </IconButton>
        </Grid>
        <Grid item container justifyContent="space-between">
          <IconButton size="small">
            <KeyboardArrowLeftIcon className={`arrow-icon ${symbol === '<' && 'left'}`} />
          </IconButton>
          {value}
          <IconButton size="small">
            <KeyboardArrowRightIcon className={`arrow-icon ${symbol === '>' && 'right'}`} />
          </IconButton>
        </Grid>
      </Grid>
    </div>
  );
};

export default ComparisonSudokuCell;
